import React from 'react';
import Sidebar from './Sidebar';

const AccountPage = () => {
    return (
        <div>
            <Sidebar content={sidebarContent} />
            <h1>Favoriler</h1>
            <p>Burada favori ürünlerinizi görebilirsiniz.</p>
        </div>
    );
};

export default AccountPage;
